window.bookSummaryJSON = "<p><b>Climber academy was only the beginning....</b></p> <p>Now an official tower climber, Max is thrust into the competitive and deadly world of the tower.&nbsp;</p> <p>While taking on dangerous missions and defending the city against powerful monster-waves, Max must train and uncover the truth about his past.&nbsp;&nbsp;</p> <p>With new information on his lost sister’s whereabouts, the stakes to ascend the mysterious tower couldn’t be greater.&nbsp;</p> <p>But warring clans and an evil organization of rogue climbers stand in the way of Max’s goals.&nbsp;</p> <p><b>Will Max be able to gain enough power to break through those who wish to stop him? </b></p> <p><b><i>Tower Climber 2</i></b><b> is the continuation of the best-selling LitRPG/Progression Fantasy series by Jakob Tanner, author of </b><b><i>Arcane Kingdom Online</i></b><b>. The story contains RPG mechanics, stats, and ranks as a form of power progression. </b>&nbsp;</p> <p><b>Pick it up today!</b></p>"; 
